import React from 'react';
import Calendar from './calendar';

class OfferReservationPage extends React.Component {
    render() {
        return (
            
                <Calendar style={{ position: 'relative', margin: '5rem auto' }} width="30rem" />
        );
    };
};

export default OfferReservationPage;
